    must be met so that payments for campaign materials are exempt from the definition
    of contribution or expenditure.  Campaign materials such as mail must be distributed
    by volunteers, and no public advertising may be used, including no direct mail
    by commercial vendors or using commercial lists.  The committee also understands
    that such activities must be paid with funds permitted under the Act; that none
    of the funds may have been designated for a particular candidate; and that no
    funds transferred-in from a national committee designated for the exempt activity
    may be used for these exempt activities.  The committee had raised enough funds
